window.bookSummaryJSON = "<p>I didn’t ask for any of this. </p> <p>I didn’t ask to be some kind of hero. </p> <p>But when your whole life gets swept up by a tornado - taking you with it - you have no choice but to go along, you know? </p> <p>Sure, I’ve read the books. I’ve seen the movies. I know the song about the rainbow and the happy little bluebirds. But I never expected Oz to look like this. To be a place where Good Witches can’t be trusted, Wicked Witches may just be the good guys, and winged monkeys can be executed for acts of rebellion. There’s still a yellow brick road - but even that’s crumbling. </p> <p>What happened? Dorothy. </p> <p>They say she found a way to come back to Oz. They say she seized power and the power went to her head. And now no one is safe. </p> <p>My name is Amy Gumm - and I’m the other girl from Kansas. </p> <p>I've been recruited by the Revolutionary Order of the Wicked. </p> <p>I’ve been trained to fight. </p> <p>And I have a mission.</p>"; 
